import React, { useEffect, useState } from "react";
import { fetchDoctorProfile } from "../services/api";

const Profile = () => {
  const [profile, setProfile] = useState(null);
  const profileId = 1; // Replace with dynamic ID as needed

  useEffect(() => {
    const fetchProfileData = async () => {
      try {
        const data = await fetchDoctorProfile(profileId);
        setProfile(data); // Assuming API returns a single profile object
      } catch (error) {
        console.error("Error fetching profile:", error);
      }
    };
    fetchProfileData();
  }, []);

  if (!profile) {
    return <div>Loading...</div>;
  }

  return (
    <div className="profile">
      <h2>{profile.name}</h2>
      <p><strong>Degree:</strong> {profile.degree}</p>
      <p><strong>Experience:</strong> {profile.experience} years</p>
      <p><strong>Expertise:</strong> {profile.top_expertise}</p>
      <p><strong>Phone:</strong> {profile.phone_number}</p>
      <p><strong>Address:</strong> {profile.address}</p>
      <p><strong>Hospital:</strong> {profile.hospital}</p>
      <p><strong>Fees:</strong> ${profile.fees}</p>
      <p><strong>Available Days:</strong> {profile.available_days}</p>
      <p><strong>Timings:</strong> {profile.available_timings}</p>
    </div>
  );
};

export default Profile;
